import "../componant_style/componant.css";

export default function AboutUsHero({ title }) {
  return (
    <section
      className="section-top"
      style={{
        backgroundImage: "url(/image/section-bg-2.png)",
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
        padding: "80px 15px",
      }}
    >
      <div className="container">
        <div className="col-lg-10 offset-lg-1 text-center">
          <div
            className="section-top-title wow fadeInRight"
            data-wow-duration="1s"
            data-wow-delay="0.3s"
            data-wow-offset="0"
            style={{
              visibility: "visible",
              animationDuration: "1s",
              animationDelay: "0.3s",
              animationName: "fadeInRight",
            }}
          >
            <h1 style={{ 
              fontSize: "clamp(24px, 5vw, 50px)", 
              marginBottom: "20px" 
            }}>
              {title}
            </h1>
            <ul style={{ 
              display: "flex", 
              justifyContent: "center", 
              flexWrap: "wrap", 
              gap: "5px", 
              padding: 0, 
              listStyle: "none", 
              fontSize: "clamp(14px, 2vw, 18px)" 
            }}>
              <li>
                <a href="/home" style={{ textDecoration: "none", color: "#fff" }}>Home</a>
              </li>
              <li>/ {title}</li>
            </ul>
          </div>
        </div>
      </div>
    </section>
  );
}
